INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 1, 10021, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2030/12/17 14:59:59", 24015, 0.0, 110501, 0.0, 4, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 2, 10021, 4, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2030/12/17 14:59:59", 24016, 0.0, 110501, 4.0, 1, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 3, 10021, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2030/12/17 14:59:59", 24017, 0.0, 110501, 0.0, 4, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 4, 10021, 1, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2030/12/17 14:59:59", 24018, 0.0, 110501, 5.2, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 5, 10021, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2030/12/17 14:59:59", 24019, 0.0, 110501, 4.2, 6, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 6, 10021, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2030/12/17 14:59:59", 24020, 0.0, 110501, 0.0, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 7, 10021, 1, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2030/12/17 14:59:59", 24021, 0.0, 110501, 6.4, 6, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 8, 10021, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2030/12/17 14:59:59", 24022, 0.0, 110501, 0.0, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 9, 10021, 6, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2030/12/17 14:59:59", 24023, 0.0, 110501, 10.08, 3, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 10, 10021, 1, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2030/12/17 14:59:59", 24024, 0.0, 110501, 5.0, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, "カオリ（サマー）", 11, 10021, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2030/12/17 14:59:59", 24025, 0.0, 110501, 0.0, 2, "2019/07/31 12:00:00");
